import React from 'react'
import { number } from 'prop-types'

export default function CloseIcon ({
  width,
  height,
  callback
}) {
  return <img
    onClick={callback}
    width={width}
    height={height}
    src='data:image/svg+xml;base64,'
    alt='Close Icon'
  />
}

CloseIcon.propTypes = {
  width: number,
  height: number,
  callback: () => {}
}
